/** CONSTANTS */
var BALL_SPEED_COEFFICIENT = 1;
var BALL_RADIUS = 10;
var PLAYER_RADIUS = 15;
var DISK_BALL = 0;

/** GLOBALS */
var powerActive = false; //You can kick the ball faster when this is true.
var PowerCoefficient = BALL_SPEED_COEFFICIENT; //Original ball kick speed would be multiplied by this number when power shot is activated.
var TimeOut = 800; //This means 60 frames per second.
var TimePlayerBallTouch = 0; //The time indicator that increases as player touched to the ball

var assistingTouch = '';
var lastPlayerTouched = '';
var lastTeamTouched = 0;
var previousPlayerTouched;
var radiusBall = BALL_RADIUS; //Classic map puck radius, you can change it with respect to the ball radius of your map.
var radiusPlayer = PLAYER_RADIUS; //The original player radius, you can change it with respect to the player radius of your map.
var triggerDistance = radiusBall + radiusPlayer + 0.01; //Player ball distance tolerance. You can increase it for less sensitivity.
var frameCounter = 0; // This is used to count the number of frames since the last goal on the game.
var sendAnnouncements = false; // This is used to prevent the bot from sending too many announcements.

var roomConfig = {
    roomName: 'My room akif',
    noPlayer: true,
    playerName: 'bot',
    maxPlayers: 16,
    public: false, // Room will be public (default is true)
};
var room = HBInit(roomConfig);

// var realSoccer = maps.sametinHarita[0];
// Create an object to hold the goals for each player
var playerGoals = {};

function logTopScorers() {
    var players = Object.keys(playerGoals).map(function (id) {
        return room.getPlayer(parseInt(id));
    });

    // Sort the players by their scores in descending order
    players.sort(function (a, b) {
        return playerGoals[b.id] - playerGoals[a.id];
    });

    // Send a message to the chat for each player
    players.forEach(function (player, index) {
        if (index === 0) {
            // This is the best player
            room.sendAnnouncement('🏆🎉  ' + player.name + '! Top scorer with ' + playerGoals[player.id] + ' goal(s)! 🎉🏆');
        } else {
            // This is not the best player
            room.sendAnnouncement(index + 1 + ' - ' + player.name + ' scored ' + playerGoals[player.id] + ' goal(s).');
        }
    });
}

function getLastTouchTheBall() {
    var ballPosition = room.getBallPosition();
    var players = room.getPlayerList();
    for (var i = 0; i < players.length; i++) {
        if (players[i].position != null && ballPosition != null) {
            var distanceToBall = pointDistance(players[i].position, ballPosition);
            if (distanceToBall < triggerDistance) {
                if (lastPlayerTouched.id != players[i].id) {
                    if (lastTeamTouched == players[i].team) {
                        assistingTouch = lastPlayerTouched;
                    } else {
                        assistingTouch = '';
                    }
                }
                lastTeamTouched = players[i].team;
                previousPlayerTouched == lastPlayerTouched;
                lastPlayerTouched = players[i];
            }
        }
    }
    return lastPlayerTouched;
}

function pointDistance(p1, p2) {
    var d1 = p1.x - p2.x;
    var d2 = p1.y - p2.y;
    return Math.sqrt(d1 * d1 + d2 * d2);
}

function CheckPowerShot() {
    const playerPosition = room.getPlayerDiscProperties(lastPlayerTouched.id);
    const ballPosition = room.getDiscProperties(DISK_BALL);
    if (
        playerPosition !== null &&
        ballPosition !== null &&
        pointDistance(playerPosition, ballPosition) < triggerDistance
    ) {
        TimePlayerBallTouch++;

        if (TimePlayerBallTouch == TimeOut) {
            room.sendAnnouncement('✅ Power shot activated!', null, 0x00ff00, 'italic', 2); //Power shot is activated when the player touches to the ball for 3 seconds long.
        }
        if (TimePlayerBallTouch >= TimeOut) {
            if (powerActive == false) {
                powerActive = true;
            }
        }
    } else {
        if (TimePlayerBallTouch != 0) {
            //Touch timer is reset when the contact between player and ball is interrupted.
            TimePlayerBallTouch = 0;
            // room.sendAnnouncement('🚫 Power shot inactivated!', null, 0xff0000, 'italic', 2); //You can remove this to prevent bot to spam too much.
        }
    }
}

room.onGameStart = function () {
    playerGoals = {};
    // Get the ball properties
    var ball = room.getDiscProperties(0);

    // Change the speed limit of the ball
    ball.speed = 120; // Set your desired speed here

    // Set the new properties
    room.setDiscProperties(0, ball);

    // Set the first map from your maps list as the current stadium
    if (maps.length > 0) {
        room.setCustomStadium(maps[0][0]);
    }
};

room.onPlayerJoin = function (player) {
    room.sendAnnouncement('Welcome ' + player.name + ' !');
    // room.sendAnnouncement('Type !admins to become admin.');
    // room.sendAnnouncement('Type !rs to play Real Soccer.');
};
room.onTeamGoal = function (teamId) {
    // Get the last player who touched the ball
    var playerLastTouchToBall = getLastTouchTheBall();

    // Check if the player is not null (own goals are attributed to null)
    if (playerLastTouchToBall) {
        // Check if the player's team is the same as the team that scored
        if (playerLastTouchToBall.team !== teamId) {
            // The player scored an own goal
            room.sendAnnouncement(playerLastTouchToBall.name + ' scored an own goal! LOOSER!!!');
        } else {
            // The player scored a goal for their own team
            // If the player has not scored before, initialize their goals to 0
            if (!playerGoals[playerLastTouchToBall.id]) {
                playerGoals[playerLastTouchToBall.id] = 0;
            }

            // Increment the player's goals
            playerGoals[playerLastTouchToBall.id]++;
            frameCounter = 0;
            sendAnnouncements = true;

            // Send a message to the chat
            room.sendAnnouncement(
                playerLastTouchToBall.name + ' has scored ' + playerGoals[playerLastTouchToBall.id] + ' goal(s)!',
            );
        }
    }
};

room.onPlayerChat = function (player, message) {
    if (message == '!sudo') {
        // Get the list of players
        var players = room.getPlayerList();

        // Check if there's an admin in the room
        // var hasAdmin = players.some(player => player.admin);

        // If there's no admin, make the first player the admin
        if (players.length > 0) {
            room.setPlayerAdmin(players[0].id, true);
        }
        // Remove admin rights from all players
        // room.getPlayerList().forEach((p) => {
        //     if (p.admin) {
        //         room.setPlayerAdmin(p.id, false);
        //     }
        // });
        // Set the new player as admin
        // const specialPlayerNames = ['bounding-box', 'solarGüç'];
        // if (specialPlayerNames.includes(player.name)) room.setPlayerAdmin(player.id, true);
        // else room.sendAnnouncement('No no no no noooo, you are not allowed to be an admin brooo!');

        return false;
    }
    if (player.admin) {
        // if message inclused !rs number then set the stadium to custom map and start the game
        if (message.includes('!rs')) {
            var mapNumber = Number(message.split(' ')[1]);
            if (!isNaN(mapNumber) && mapNumber >= 0 && mapNumber < maps.length) {
                room.stopGame();
                room.setCustomStadium(maps[mapNumber][0]);
                room.startGame();
            } else {
                room.sendAnnouncement('Please enter a valid map number');
            }
            return false;
        }
        // Check if the player is an admin and the message starts with "!speed"
        if (player.admin && message.startsWith('!speed ')) {
            // Parse the new speed from the message
            var newSpeed = parseFloat(message.split(' ')[1]);

            // Check if the new speed is a number
            if (!isNaN(newSpeed)) {
                // Get the ball properties
                var ball = room.getDiscProperties(0);

                // Set the new speed
                ball.speed = newSpeed;

                // Update the ball properties
                room.setDiscProperties(0, ball);

                // Notify the room
                room.sendAnnouncement('Ball speed has been set to ' + newSpeed + ' by ' + player.name);
            }
        }
        // if message has time then update timelimit of the game
        if (message.includes('time')) {
            var time = message.split(' ')[1];
            if (time) {
                room.setTimeLimit(time);
                room.sendAnnouncement('Time limit updated to ' + time);
            } else {
                room.sendAnnouncement('Please enter a valid time limit');
            }
            return false;
        }
        // if message has score then update scorelimit of the game
        if (message.includes('score')) {
            var score = message.split(' ')[1];
            if (score) {
                room.setScoreLimit(score);
                room.sendAnnouncement('Score limit updated to ' + score);
            } else {
                room.sendAnnouncement('Please enter a valid score limit');
            }
            return false;
        }
        // if message has power then update PowerCoefficient of the acceleration
        if (message.includes('power')) {
            var power = message.split(' ')[1];
            var time = message.split(' ')[2]; // in seconds
            if (power) {
                PowerCoefficient = power;
                var timeMessage = '';
                if (time) {
                    TimeOut = time * 60; //This means 60 frames per second.
                    timeMessage = ' for ' + time + ' seconds';
                }
                room.sendAnnouncement('Power shot coefficient updated to ' + power + timeMessage);
            } else {
                room.sendAnnouncement('Please enter a valid power shot coefficient');
            }
            return false;
        }
        if (message == '!help') {
            // Define the available commands
            var commands = [
                '!sudo - Make yourself an admin',
                '!rs - Stop the game, set the stadium to custom map, and start the game',
                '!speed [number] - Set the speed of the ball (admin only)',
                '!time [number] - Set the time limit of the game (admin only)',
                '!score [number] - Set the score limit of the game (admin only)',
                '!power [number] [number] - Set the power shot coefficient of the acceleration, and the frequency of it in seconds. (admin only)',
            ];

            // Send each command as a separate message
            commands.forEach(function (command) {
                room.sendAnnouncement(command);
            });

            // Prevent the !help message from being displayed in the chat
            return false;
        }
        // if message has bouncing and number and player name, then change that player's bouncing value
        if (message.includes('bouncing')) {
            var playerName = message.split(' ')[1];
            var bouncing = message.split(' ')[2];
            if (playerName && bouncing) {
                // find player with the name
                var player = room.getPlayerList().find((p) => p.name === playerName);
                if (player) {
                    room.setPlayerDiscProperties(player.id, { bCoeff: bouncing });
                    room.sendAnnouncement(playerName + ' bouncing coefficient updated to ' + bouncing);
                } else {
                    room.sendAnnouncement('Please enter a valid player name');
                }
            } else {
                room.sendAnnouncement('Please enter a valid player name and bouncing coefficient');
            }
            return false;
        }
        // Check if the player is an admin and the message starts with "!kick"
        if (message.startsWith('!kick ')) {
            // Extract the name of the player to be kicked
            var nameToKick = message.split(' ')[1];

            // Find the player in the room
            var playerToKick = room.getPlayerList().find((p) => p.name === nameToKick);

            // If the player is found, kick them from the room
            if (playerToKick) {
                room.kickPlayer(playerToKick.id, "Player disconnected", false);
            }
        }
    }
};

room.onPlayerBallKick = function (player) {
    //Ball speed is multiplied by the speed coefficient when power shot is active.
    if (powerActive == true) {
        room.setDiscProperties(0, {
            xspeed: PowerCoefficient * room.getDiscProperties(0).xspeed,
            yspeed: PowerCoefficient * room.getDiscProperties(0).yspeed,
        });
        powerActive = false;
    }
};

room.onGameStop = function (byPlayer) {
    //This is important to avoid from gametick errors.
    lastPlayerTouched = '';
    // Convert the playerGoals object to an array of players
    logTopScorers();
    playerGoals = {};
    sendAnnouncements = false;
};

room.onGameTick = function () {
    if (room.getPlayerList().filter((p) => p.team != 0).length > 0 && lastPlayerTouched != '') {
        //This is also important to avoid from gametick errors.
        CheckPowerShot();
    }

    frameCounter++;
    if (frameCounter % (30 * 60) === 0 && sendAnnouncements) {
        logTopScorers();
    }

    getLastTouchTheBall(); //You have to use this in here to get the last toucher.
};

